import i18n from 'i18next';
import { initReactI18next } from 'react-i18next';

const resources = {
  en: {
    translation: {
      "Enter your details to continue": "Enter your details to continue",
      "Username": "Username",
      "Phone Number": "Phone Number",
      "OTP": "OTP",
      "Login": "Login"
    }
  },
  hi: {
    translation: {
      "Enter your details to continue": "जारी रखने के लिए अपना विवरण दर्ज करें",
      "Username": "उपयोगकर्ता नाम",
      "Phone Number": "फ़ोन नंबर",
      "OTP": "ओटीपी",
      "Login": "लॉगिन"
    }
  },
  te: {
    translation: {
      "Enter your details to continue": "కొనసాగించడానికి మీ వివరాలను నమోదు చేయండి",
      "Username": "వినియోగదారు పేరు",
      "Phone Number": "ఫోన్ నంబర్",
      "OTP": "ఓటీపీ",
      "Login": "లాగిన్"
    }
  }
};

i18n
  .use(initReactI18next)
  .init({
    resources,
    lng: 'en', // default language
    interpolation: {
      escapeValue: false
    }
  });

export default i18n;
